	final private void jj_rescan_token()
	{
		jj_rescan = true;
		for(int i = 0; i < 4; i++)
		{
			JJCalls p = jj_2_rtns[i];
			do
			{
				if(p.gen > jj_gen)
				{
					jj_la = p.arg;
					jj_lastpos = jj_scanpos = p.first;
					switch(i)
					{
						case 0:
							jj_3_1();
							break;
						case 1:
							jj_3_2();
							break;
						case 2:
							jj_3_3();
							break;
						case 3:
							jj_3_4();
							break;
					}
				}
				p = p.next;
			} while(p != null);
		}
		jj_rescan = false;
	}

	final private void jj_save(int index, int xla)
	{
		JJCalls p = jj_2_rtns[index];
		while(p.gen > jj_gen)
		{
			if(p.next == null)
			{
				p = p.next = new JJCalls();
				break;
			}
			p = p.next;
		}
		p.gen = jj_gen + xla - jj_la;
		p.first = token;
		p.arg = xla;
	}

	static final class JJCalls
	{
		int gen;
		Token first;
		int arg;
		JJCalls next;
	}

